import React from 'react';
import {Button,FormGroup,FormControl,ControlLabel} from 'react-bootstrap';
import './App.css';

function App() {
  return (
    <div className="Login">
   <Form>
     <FormGroup controlId = "UserName">
     <ControlLabel>
       UserName
     </ControlLabel>
       <FormControl type="UserName" placeholder="enter your username">
       </FormControl>
     </FormGroup>
   </Form>
    </div>
  );
}

export default App;
